import React, { Component } from 'react'
import './Navbar.css'

class Navbar extends Component {
  render () {
    return (
      <nav className='navbar-main'>
         <h1 className='navbar-title'>Keep it, Track it</h1>
      </nav>
    );
  }
}

export default Navbar;
